import React, {useState} from 'react';
import Pages from "./Pagination/Pages";
import "./CarsPageStyle.css"
import CarCard from "./CarsCard/CarsCard";
import axios from "axios";
import {Card} from "react-bootstrap";
import CarsCard from "./CarsCard/CarsCard";

function CarsPage(props) {
    const [cars, setCars] = useState(undefined);
    let carsCards = []



    return (
    <div className={"main-container"}>
        <div className={"cars-content"}>
            <button className={"test-btn"} onClick={() => {
                console.log(axios)
                axios.get("http://localhost:8888/cars/get-car-page", {
                    params: {
                        'page': 1,
                        'per-page': 5
                    }
                }).then(it => {
                        console.log(it())
                        setCars(it.data)
                        cars.items.forEach(car => {carsCards.push(<CarsCard price={car.price} name={car.name}/>)})
                    }
                )
                }}/>
            <div className="container cars-container">
                <div className="row">
                    {carsCards}
                </div>
            </div>
            <Pages />
        </div>

    </div>
    );
}

export default CarsPage;
